import React from 'react';

import styles from './../Style/Components/Servers.module.css';

//Modules 
import Server from './Server';

type MyProps = { };
type MyState = { Active: number, Servers: Map<number, string> };
class Servers extends React.Component<MyProps, MyState> {
  public state: MyState;
  constructor(props) {
    super(props);
    this.state = {
      Active: 123,
      Servers: new Map([
        [ 123, 'Testing' ]
      ]) 
    };
  }
  Change_Server() {

  }
  render() {
    return (
      <section className={styles.Container}>
        {
          (() => {
            let Comps = [];
            for (let [key, value] of this.state.Servers) {
              Comps.push(
                <Server 
                  key={key}
                  id={value}
                  Active={this.state.Active}
                  onclick={this.Change_Server}
                />
              );
            }
            return Comps;
          })()
        }
      </section>
    );
  }
}

export default Servers;
